import React from "react";
import { Marker } from "react-google-maps";

class Markers extends React.Component {
  constructor() {
    super();
    this.state = {
      cases: [],
    };
  }

  componentDidMount() {
    this.data();
  }

  data() {
    fetch(
      "https://opendata.arcgis.com/datasets/bbb2e4f589ba40d692fab712ae37b9ac_1.geojson"
    )
      .then((response) => response.json())
      .then(
        (responseJson) => this.setState({ cases: responseJson })
        // jsonData is parsed json object received from url
      );
  }
  render() {
    return this.state.cases.features.map(function (cases) {
      return (
        <Marker
          key={cases.properties.OBJECTID}
          position={{
            lat: cases.geometry.coordinates[1],
            lng: cases.geometry.coordinates[0],
          }}
        />
      );
    });
  }
}

export default Markers;
